-- CREATE SCHEMA/Database
DROP DATABASE IF EXISTS `udisc_db`;
CREATE DATABASE `udisc_db`; 
USE `udisc_db`;

SET NAMES utf8 ;
SET character_set_client = utf8mb4 ;

-- CREATE Table Parameters - usdisc.db.scorecards
CREATE TABLE scorecards(
   PlayerName VARCHAR(14) NOT NULL
  ,CourseName VARCHAR(34) NOT NULL
  ,LayoutName VARCHAR(34) NOT NULL
  ,Date       DATETIME  NOT NULL
  ,Total      INT  NOT NULL
  ,Net_Score  INT  NOT NULL
  ,Hole1      INT  NOT NULL
  ,Hole2      INT  NOT NULL
  ,Hole3      INT  NOT NULL
  ,Hole4      INT  NOT NULL
  ,Hole5      INT  NOT NULL
  ,Hole6      INT  NOT NULL
  ,Hole7      INT  NOT NULL
  ,Hole8      INT  NOT NULL
  ,Hole9      INT  NOT NULL
  ,Hole10     INT 
  ,Hole11     INT 
  ,Hole12     INT 
  ,Hole13     INT
  ,Hole14     INT
  ,Hole15     INT
  ,Hole16     INT
  ,Hole17     INT
  ,Hole18     INT
  ,Hole19     INT
  ,Hole20     INT
);

